Relevant official examples: hierarchy , parenting . Technically, the Entities/Components themselves cannot form a hierarchy (the ECS is a flat data structure). However, logical hierarchies are a common pattern in games. Bevy supports creating such a logical link between entities, to form a virtual "hierarchy", by simply adding Parent and Children components on the respective entities. When using Commands to spawn entities, Commands has methods for adding children to entities, which automatically add the correct components: // spawn the parent and get its Entity id
let parent = commands.spawn_bundle(MyParentBundle::default()) .id(); // do the same for the child
let child = commands.spawn_bundle(MyChildBundle::default()) .id(); // add the child to the parent
commands.entity(parent).push_children(&[child]); // you can also use `with_children`:
commands.spawn_bundle(MyParentBundle::default()) .with_children(|parent| { parent.spawn_bundle(MyChildBundle::default()); }); You can despawn an entire hierarchy with a single command : fn close_menu( mut commands: Commands, query: Query<Entity, With<MainMenuUI>>,
) { for entity in query.iter() { // despawn the entity and its children commands.entity(entity).despawn_recursive(); }
}

