The simplest use case is to just load a "3D model" and spawn it into the game world. "3D models" can often be complex, consisting of multiple parts. Think of a house: the windows, roof, doors, etc., are separate pieces, that are likely made of multiple meshes, materials, and textures. Bevy would technically need multiple ECS Entities to represent and render the whole thing. This is why your GLTF "model" is represented by Bevy as a Scene. This way, you can easily spawn it, and Bevy will create all the relevant child entities and configure them correctly. So that you can treat the whole thing as "a single object" and position it in the world, you can just spawn it under a parent entity, and use its Transform . fn spawn_gltf( mut commands: Commands, ass: Res<AssetServer>,
) { // note that we have to include the `Scene0` label let my_gltf = ass.load("my.glb#Scene0"); // to be able to position our 3d model: // spawn a parent entity with a Transform and GlobalTransform // and spawn our gltf as a scene under it commands.spawn_bundle(( Transform::from_xyz(2.0, 0.0, -5.0), GlobalTransform::identity(), )).with_children(|parent| { parent.spawn_scene(my_gltf); });
} If your GLTF Scene represents "a whole level/map", rather than "an individual 3d model", and you don't need to move it around, you can just spawn the scene directly, without creating a parent entity. Also, this example assumes that you have a simple GLTF file containing only one "default scene". GLTF is a very flexible file format. A single file can contain many "models" or more complex "scenes". To get a better understanding of GLTF and possible workflows, read the rest of this page. :)

